import React, { Component } from 'react';
import { NavLink } from 'react-router-dom';
import '../styles.css';
//import axios from 'axios';
//import { isLoginAdmin,isLogin,isLoginClient } from './Accueil';

//#80D0D0
class Navbar extends Component {


    refreshNavBar=()=> {
        window.location.reload(false)
     }

    myFunction=()=> {
        var x = document.getElementById("myTopnav");
        if (x.className === "topnav") {
          x.className += " responsive";
        } else {
          x.className = "topnav";
        }
      }

    render(){
        return (
            <nav className="navbar navbar-default navbar-expand-sm" id='navbar' style={{
                height:80
            }}>
                <div className="container-fluid">
                    <div className="navbar-header">   
                        <h2 to="/" className="navbar-brand"  style={{fontSize:25, marginTop:10,
                                color:"#660099",fontWeight:'bold',marginLeft:10}}>ONLINE SCHOOL</h2>                     
                    </div>
                    <div className="collapse navbar-collapse topnav" id="myTopnav" >
                        <ul className="nav navbar-nav navbar-right ul mr-auto" style={{ marginTop:10}} >

                            <li className="li_nav" activeClassName="main-nav">
                                <NavLink exact to="/">Accueil</NavLink>
                            </li>
                            <li className="li_nav" activeClassName="main-nav">
                                <NavLink to="/Concours">Concours</NavLink>
                            </li>
                            <li className="li_nav" activeClassName="main-nav">
                                <NavLink to="/Examens">Examens</NavLink>
                            </li>
                            <li className="li_nav" activeClassName="main-nav">
                                <NavLink to="/contact">Nous contacter</NavLink>
                            </li>
                            <button onClick={this.deconnexion} className="button" style={{backgroundColor:"gray"}} >
                                <a className="navbar-brand" style={{color:'white',margin:"auto"}}>S'abonner</a>
                            </button>
                            <button onClick={this.deconnexion} className="button" style={{backgroundColor:"#660099"}} >
                                <a className="navbar-brand" style={{color:"white",margin:"auto"}}>Connexion</a>
                            </button>
                            <li className="li_nav" activeClassName="main-nav">
                            <a className="icon" onclick={this.myFunction}>&#9776;</a>
                            </li>
                        </ul>
                    </div>
                </div>
            </nav>
        );
    }
}

export default Navbar
